/************************ Env ************************/
function Env(scriptName) {
    this.startTime = new Date().getTime()
    this.name = scriptName
    this.isQuanX = typeof $task != "undefined"
    this.isLoon = typeof $loon !== "undefined"
    this.isSurge = typeof $httpClient !== "undefined" && typeof $utils !== "undefined"
    this.isNode = typeof require == "function"
    this.log = (...logs) => console.log([...logs].join('\n'))
    this.getEnv = () => {
        if (this.isQuanX) return "QuanX"
        if (this.isSurge) return "Surge"
        if (this.isLoon) return "Loon"
        if (this.isNode) return "Node"
    }
    this.log('', `üîî${this.name}, ÂºÄÂßã!`)
    this.log('', `==============ÂΩìÂâçÁéØÂ¢É:${this.getEnv()}==============`)
    this.notify = (title = this.name, subtitle = '', content = '', options = {}) => {
        typeof options == "string" && /:\/\//.test(options) && (options = { "open-url": options })
        const openURL = options["open-url"] || "" // Ë∑≥ËΩ¨ÈìæÊé•
            , mediaURL = options["media-url"] || "" // Â™í‰ΩìÈìæÊé•
            , { isQuanX, isSurge, isLoon, isNode } = this
        Object.keys(options).length > 0 && Object.keys(options).forEach(key => (!options[key] || !/:\/\//.test(options[key])) && delete options[key])
        if (isNode) {
            let logs = ['', '==============üì£Á≥ªÁªüÈÄöÁü•üì£==============']
            logs.push(title)
            subtitle ? logs.push(subtitle) : ''
            content ? logs.push(content +
                (openURL ? `\nÁÇπÂáªË∑≥ËΩ¨: ${openURL}` : "") +
                (mediaURL ? `\nÂ§öÂ™í‰Ωì: ${mediaURL}` : "")) : ''
            console.log(logs.join('\n'))
        }
        if (isQuanX) $notify(title, subtitle, content, options)
        if (isSurge) $notification.post(title, subtitle, content + `${mediaURL ? "\nÂ§öÂ™í‰Ωì:" + mediaURL : ""}`, { url: openURL, });
        if (isLoon) Object.keys(options).length === 0 ? $notification.post(title, subtitle, content) : $notification.post(title, subtitle, content, { openUrl: openURL, mediaUrl: mediaURL });
    }
    this.done = (val = {}) => {
        const endTime = new Date().getTime()
        const costTime = (endTime - this.startTime) / 1000
        this.log('', `üîî${this.name}, ÁªìÊùü! üïõ ${costTime} Áßí`)
        switch (this.getEnv()) {
            case 'QuanX':
            case 'Surge':
            case 'Loon':
            default:
                $done(val)
                break
            case 'Node':
                process.exit(1)
                break
        }
    }
}